export declare const string = "<div class=\"markdown-body\" [@childStag50]=\"routes\"><table [class.table-hover-warning]=\"selectable\"><thead><tr><th>METHOD</th><th>ROUTE</th><th>RETURNS</th><th>STAT</th></tr></thead><tbody><tr class=\"childFx\" *ngFor=\"let route of routes|array\" [class.cursor-pointer]=\"selectable\" [@200]=\"'fadeInUp'\"><td (click)=\"select.emit(route)\">{{ route.method }}</td><td><div *ngIf=\"links\"><a href=\"#{{route.method+':'+route.path | markdownAnchor}}\" attr.replaceref=\"#{{route.method+':'+route.path | markdownAnchor}}\" pageScroll=\"pageScroll\">{{ route.path }}</a></div><div *ngIf=\"!links\">{{ route.path }}</div></td><td (click)=\"select.emit(route)\">{{ route.returnType }}</td><td class=\"text-3x\" (click)=\"select.emit(route)\"><div class=\"child-margin-xxs\" *ngIf=\"route.status\"><span *ngFor=\"let status of route.status|array\" [attr.title]=\"statIconMap[status] ? statIconMap[status].details : status\">{{ statIconMap[status].icon ? statIconMap[status].icon : status }}</span></div></td></tr></tbody></table></div>";
